methods/calls/postCallsCallIdAudio.html.body:
POST calls/{callId}/audio
Plays an audio file or speak a sentence in a phone call.
Supported Parameters



Parameter
Description
Mandatory




fileUrl
The location of an audio file to play (WAV and MP3 supported).
No


sentence
The sentence to speak.
No


gender
The gender of the voice used to synthesize the sentence. It will be considered only if sentence is not null. The female gender will be used by default.
No


locale
The locale used to get the accent of the voice used to synthesize the sentence. Currently audio supports:  - en_US or en_UK (English)  - es or es_MX (Spanish)  - fr or fr_FR (French)  - de or de_DE (German)  - t or it_IT (Italian) It will be considered only if sentence is not null/empty. The en_US will be used by default.
No


voice
The voice to speak the sentence. Audio currently supports the following voices:  - English US: Kate, Susan, Julie, Dave, Paul  - English UK: Bridget  - Spanish: Esperanza, Violeta, Jorge  - French: Jolie, Bernard  - German: Katrin, Stefan  - Italian: Paola, Luca It will be considered only if sentence is not null/empty. Susan’s voice will be used by default.
No


loopEnabled
When value is true , the audio will keep playing in a loop. Default: false.
No


tag
A string that will be included in the events delivered when the audio playback starts or finishes.
No



Example: Speak a Sentence
curl -v -X POST https://api.catapult.inetwork.com/v1/users/{userId}/calls/{callId}/audio \
    -u {token}:{secret} \
    -H "Content-type: application/json" \
    -d \
    '
    {
        "gender": "female",
        "sentence": "Hello, thank you for calling.",
        "locale": "en_US",
        "voice": "julie"
    }'

//Speak sentence with options
var options = {
    sentence : "hola de Bandwidth",
    gender   : "male",
    locale   : "es",
    voice    : "Jorge"
}
//Promise
client.Call.playAudioAdvanced("callId", options).then(function (res) {});

//Callback
client.Call.playAudioAdvanced("callId", options, function (err,res) {});

//Speak sentence in a call

//Promise
